import React, {useState, useEffect} from 'react';
import classes from '../../../CSS/Main.module.css'

const LogicContainers = () =>{
    const P1 = [[0,2,0,9,0,0,5,0,0]]
    let pushpuzzle = (
<ul className={classes.GameComp}>
            {P1[0].map((val,index)=>{
              
                return(
                    <li key={index}></li>
                )
            })}
        </ul>
    )
    return(
        <div>
            {pushpuzzle}
        </div>
    )

}
export default LogicContainers;
